CREATE DEFINER=`root`@`localhost` PROCEDURE `female_candidates` ()  begin
declare vid int;
declare complete int default false;
declare curs CURSOR for select voter_id from voter_table where sex='F';
declare continue handler for not found set complete=true;
open curs;
get_f:LOOP
FETCH curs into vid;
if complete then
LEAVE get_f;
end if;
if EXISTS(select cand_id,fname,lname,mname,party_name from candidate_table where voter_id=vid)
then
select cand_id,concat(fname,' ',mname,' ',lname) as Name,party_name from candidate_table where voter_id=vid;
end if;
end LOOP;
close curs;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `get_candidate` (IN `vid` INT)  BEGIN
SELECT
    CAND_ID,
    FNAME,
    MNAME,
    LNAME,
    PARTY_NAME
FROM
    candidate_table
WHERE
    CAND_ID IN(
    SELECT
        CAND_ID
    FROM
        cand_cons_table
    WHERE
        CT_CONS_ID =(
        SELECT
            CONS_ID
        FROM
            voter_table
        WHERE
            VOTER_ID = vid
    )
);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `report` (IN `gender` CHAR)  begin
declare complete int default false;
declare vid int(10);
declare curs cursor for
select VOTER_ID from voter_table where SEX=gender;
declare continue handler for not found set complete=true;
OPEN curs;
get_vid :LOOP
FETCH curs into vid;
if complete then
LEAVE get_vid;
end if;
select CAND_ID,FNAME,LNAME from candidate_table where VOTER_ID=vid;
end LOOP;
close curs;
end$$

--
