DROP TABLE IF EXISTS `candidates_2017`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `candidates_2017`  AS  select `candidate_table`.`CAND_ID` AS `CAND_ID`,`candidate_table`.`VOTER_ID` AS `VOTER_ID`,`candidate_table`.`PARTY_NAME` AS `PARTY_NAME`,`candidate_table`.`PARTY_SYMBOL` AS `PARTY_SYMBOL`,`candidate_table`.`FNAME` AS `FNAME`,`candidate_table`.`MNAME` AS `MNAME`,`candidate_table`.`LNAME` AS `LNAME`,`candidate_table`.`EDU_LEVEL` AS `EDU_LEVEL`,`candidate_table`.`WORK_EXP` AS `WORK_EXP`,`candidate_table`.`POL_EXP` AS `POL_EXP`,`candidate_table`.`ACHIEVEMENTS` AS `ACHIEVEMENTS`,`candidate_table`.`PROP_AFF` AS `PROP_AFF`,`candidate_table`.`BUSS_AFF` AS `BUSS_AFF`,`candidate_table`.`CRIM_AFF` AS `CRIM_AFF`,`candidate_table`.`ELE_YEAR` AS `ELE_YEAR` from `candidate_table` ;

