--
-- Structure for view `caste`
--
DROP TABLE IF EXISTS `caste`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `caste`  AS  select count(`vo`.`VOTER_ID`) AS `NO OF VOTERS`,`v`.`CASTE` AS `CASTE`,`c`.`PARTY_NAME` AS `PARTY` from ((`voter_table` `v` join `vote_table` `vo` on((`v`.`VOTER_ID` = `vo`.`VOTER_ID`))) join `candidate_table` `c` on((`vo`.`CAND_ID` = `c`.`CAND_ID`))) group by `v`.`CASTE`,`PARTY` ;

